"use strict";

var _color = require("../color");

describe('check color class', function () {
  it('check css2array', function () {
    expect((0, _color.css2array)('red')).toEqual([255, 0, 0, 255]);
  });
  it('check getDistinctColors', function () {
    expect((0, _color.getDistinctColors)(4)).toEqual([[230, 0, 0], [153, 255, 51], [128, 255, 255], [76, 0, 153]]);
  });
});